const TestList = () => {
  let [list, listChange] = useState([
    { id: 1, name: "A", age: 1 },
    { id: 2, name: "B", age: 2 },
    { id: 3, name: "C", age: 3 },
  ]);

  return (
    <div>
      <div>list</div>
    </div>
  );
};

export default TestList;
